import React, { useEffect } from "react";
//styles
import GlobalStyles from "./Global.styles";
//components
import Header from "./components/Header";

function App() {
    useEffect(() => {
        let vh = window.innerHeight * 0.01;
        document.documentElement.style.setProperty("--vh", `${vh}px`);
    });
    return (
        <>
            <GlobalStyles />
            <Header />
        </>
    );
}

export default App;
